plt.xticks(range(1, len(labels) + 1), ["All Data Clumps","parameters_to_fields_data_clump","parameters_to_parameters_data_clump","fields_to_fields_data_clump"])
plt.subplots_adjust(left=0.15, right=0.95, top=0.98, bottom=0.2)
fig.set_size_inches(6, 4, forward=True)
fig.set_dpi(400)
plt.show()

